trailingComments.value:
*
 * 获取 会员 信息
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<*>}
 *
 * @example
 * 不带参数调用
 * libSQ.exec('get-member-info').then((info) => {
 *   alert(`[get-member-info][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[get-member-info][error] ${JSON.stringify(err, null, 2)}`);
 * });
 * 带参数传递调用
 * libSQ.exec('get-member-info', {
 *   params: {
 *     isRefresh: '1',
 *   },
 * }).then((info) => {
 *   alert(`[refresh][get-member-info][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[refresh][get-member-info][error] ${JSON.stringify(err, null, 2)}`);
 * });

